    "unity",nt"isopen": true,nt"url": null,nt"notes": "Development assistance
    program reporting tool.  UNITY is designed to provide data visibility for the US
    government, nongovernmental organizations (NGOs), international organizations, and
    other entities working in fragile environments. Organizations working in post-conflict
    zones tend to manage planning independently. Consequently, project activities become
    siloed, and interventions can become uncoordinated and inefficient. UNITY aggregates
    nonclassified data from partner organizations and displays it through a Web-based
    browser interface as a series of overlays, charts, graphs, and tables that are geospatially
    referenced to a map of the region.",nt"license_title": "Other License Specified",nt"extras":
